import React from "react";
import SvgPull from "../SVG/SvgPull";

const NotificationPull = ({comment, link}) => {
    if (comment) {
        return (
            <a href={link}>
               <span>
                    <SvgPull/>
               </span>
            </a>
        )
    } else return <span></span>;
}

export default NotificationPull;
